import Pollslist from './pollslist/Pollslist'
import Pollsdetails from './pollsdetails/Pollsdetails'

const Content = () => {
  return (
    <div className='d-flex justify-content-between'>
        <Pollslist />
        <Pollsdetails />
    </div>
  )
}

export default Content
